import React from 'react';
import CompleteProgress from './Home/CompleteProgress';
import Percantage from './Home/CompleteProgress';

const lists = ['PLA', 'BD', 'SH', 'LGP', 'US', 'MO', 'AS', 'X', 'B2', 'W', 'HG', 'P', 'EM', 'FR', 'CR', 'RD']
function Home() {
  return(
    <div className='Home'>
      <h1>PokeTrack</h1>
      {
        lists.map((game) => <CompleteProgress />)
      }
    </div>
  );
}

export default Home;
